      <Row>
        <img src="images/logo.svg" alt="" />{" "}
      </Row>
      <Row>
        <p>Office</p>
        <p>4 perez Drive ,</p>
        <p>Lekki Phase 1, Lagos</p>
      </Row>
      <Row>
              <p>Contact
        </p>
        <p>

          +234 809 66 8877</p>
              hello@gmail.com
        <p></p>
      </Row>
      <Row>Make it Four</Row>
    </Container>
  );
};

export default Footer;
